        dashed #ff0000;\n            }\n            [role=\"doc-footnote\"]:before
        { content: \"FOOTNOTE \" ; }\n\n            /* Show a permalink when hovering
        over a heading or paragraph */\n            *:not(:hover) &gt; a.-dev-permalinker
