        ]]&gt;</script></head><body><div data-type=\"page\" id=\"7344986b-3079-4db2-92b9-78e0644c8610\"
        data-cnxml-to-html-ver=\"2.1.1\" class=\" chapter-content-module\"><h2 data-type=\"document-title\"
        id=\"0\"><span class=\"os-number\">4.1</span><span class=\"os-divider\"> </span><span
        data-type=\"\" itemprop=\"\" class=\"os-text\">Development of Force Concept</span></h2>\n        \n        <p
        id=\"import-auto-id2380148\" class=\" \"><span data-type=\"term\" id=\"term80\"
        group-by=\"D\">Dynamics</span> is the study of the forces that cause objects
        and systems to move. To understand this, we need a working definition of force.
        Our intuitive definition of <span data-type=\"term\" id=\"term81\" group-by=\"f\">force</span>\u2014that
        is, a push or a pull\u2014is a good place to start. We know that a push or
        pull has both magnitude and direction (therefore, it is a vector quantity)
        and can vary considerably in each regard. For example, a cannon exerts a strong
        force on a cannonball that is launched into the air. In contrast, Earth exerts
        only a tiny downward pull on a flea. Our everyday experiences also give us
        a good idea of how multiple forces add. If two people push in different directions
        on a third person, as illustrated in <a href=\"#import-auto-id2379809\" class=\"autogenerated-content\">Figure
        4.2</a>, we might expect the total force to be in the direction shown. Since
        force is a vector, it adds just like other vectors, as illustrated in <a href=\"#import-auto-id2379809\"
        class=\"autogenerated-content\">Figure 4.2</a>(a) for two ice skaters. Forces,
        like other vectors, are represented by arrows and can be added using the familiar
        head-to-tail method or by trigonometric methods. These ideas were developed
        in <a href=\"./405335a3-7cff-4df2-a9ad-29062a4af261@8.46:2e7a4d00-d38b-4a1e-94ab-a899b90ba960.xhtml\"
        data-page-slug=\"3-introduction-to-two-dimensional-kinematics\" data-page-uuid=\"2e7a4d00-d38b-4a1e-94ab-a899b90ba960\"
        data-page-fragment=\"\">Two-Dimensional Kinematics</a>.</p><div class=\"os-figure\"><figure
        id=\"import-auto-id2379809\"><span data-type=\"media\" id=\"import-auto-id2659946\"
        data-alt=\"(a) Overhead view of two ice skaters pushing on a third. One skater
        pushes with a force F two, represented by an arrow pointing up, and a second
        skater pushes with a force F one, represented by an arrow pointing from left
        to right. Vector F one and vector F two are along the arms of the two skaters
        acting on the third skater. A vector diagram is shown in the form of a right
        triangle in which the base is vector F one pointing east and perpendicular
        is shown by vector F two pointing north. The resultant vector is shown by
        the hypotenuse pointing northeast. (b) Free-body diagram showing only the
        forces acting on the skater.\">\n                <img src=\"../resources/ab26b6a7c22cc63a8a6b1bd0deac9262a03ef631\"
        data-media-type=\"image/jpg\" alt=\"(a) Overhead view of two ice skaters pushing
        on a third. One skater pushes with a force F two, represented by an arrow
        pointing up, and a second skater pushes with a force F one, represented by
        an arrow pointing from left to right. Vector F one and vector F two are along
        the arms of the two skaters acting on the third skater. A vector diagram is
        shown in the form of a right triangle in which the base is vector F one pointing
        east and perpendicular is shown by vector F two pointing north. The resultant
        vector is shown by the hypotenuse pointing northeast. (b) Free-body diagram
        showing only the forces acting on the skater.\" width=\"400\" id=\"2\"/>\n            </span>\n            \n        </figure><div
        class=\"os-caption-container\"><span class=\"os-title-label\">Figure </span><span
        class=\"os-number\">4.2</span><span class=\"os-divider\"> </span><span class=\"os-caption\">Part
        (a) shows an overhead view of two ice skaters pushing on a third. Forces are
        vectors and add like other vectors, so the total force on the third skater
        is in the direction shown. In part (b), we see a free-body diagram representing
        the forces acting on the third skater.</span></div></div><p id=\"import-auto-id1374790\"
        class=\" \"><a href=\"#import-auto-id2379809\" class=\"autogenerated-content\">Figure
        4.2</a>(b) is our first example of a <span data-type=\"term\" id=\"term82\"
        group-by=\"f\">free-body diagram</span>, which is a technique used to illustrate
        all the <span data-type=\"term\" id=\"term83\" group-by=\"e\">external forces</span>
        acting on a body. The body is represented by a single isolated point (or free
        body), and only those forces acting <em data-effect=\"italics\">on</em> the
        body from the outside (external forces) are shown. (These forces are the only
        ones shown, because only external forces acting on the body affect its motion.
        We can ignore any internal forces within the body.) Free-body diagrams are
        very useful in analyzing forces acting on a system and are employed extensively
        in the study and application of Newton\u2019s laws of motion.</p><p id=\"import-auto-id1905924\"
        class=\" \">A more quantitative definition of force can be based on some standard
        force, just as distance is measured in units relative to a standard distance.
        One possibility is to stretch a spring a certain fixed distance, as illustrated
        in <a href=\"#import-auto-id2608835\" class=\"autogenerated-content\">Figure
        4.3</a>, and use the force it exerts to pull itself back to its relaxed shape\u2014called
        a <em data-effect=\"italics\">restoring force</em>\u2014as a standard. The
        magnitude of all other forces can be stated as multiples of this standard
        unit of force. Many other possibilities exist for standard forces. (One that
        we will encounter in <a href=\"./405335a3-7cff-4df2-a9ad-29062a4af261@8.46:0d0ebc3d-b23b-492f-9c2f-bf546e6677d9.xhtml\"
        data-page-slug=\"22-introduction-to-magnetism\" data-page-uuid=\"0d0ebc3d-b23b-492f-9c2f-bf546e6677d9\"
        data-page-fragment=\"\">Magnetism</a> is the magnetic force between two wires
        carrying electric current.) Some alternative definitions of force will be
        given later in this chapter.</p><div class=\"os-figure\"><figure id=\"import-auto-id2608835\"><span
        data-type=\"media\" id=\"import-auto-id2630816\" data-alt=\"(a) A spring of
        length x, fixed at one end, is shown in horizontal position. (b) The same
        spring is shown pulled by a person by a distance of delta x. The restoring
        force F restore is represented by an arrow pointing left toward the position
        where the spring is fixed. (c) A spring balance containing a spring stretched
        a distance delta x is shown. The restoring force is represented by an arrow
        F restore pointing toward the left in the direction opposite to the elongation
        of the spring.\">\n                <img src=\"../resources/d4aff46e98cf3edeee2fd2d790eef6322fbf00a8\"
        data-media-type=\"image/jpg\" alt=\"(a) A spring of length x, fixed at one
        end, is shown in horizontal position. (b) The same spring is shown pulled
        by a person by a distance of delta x. The restoring force F restore is represented
        by an arrow pointing left toward the position where the spring is fixed. (c)
        A spring balance containing a spring stretched a distance delta x is shown.
        The restoring force is represented by an arrow F restore pointing toward the
        left in the direction opposite to the elongation of the spring.\" width=\"400\"
        id=\"3\"/>\n            </span>\n            \n        </figure><div class=\"os-caption-container\"><span
        class=\"os-title-label\">Figure </span><span class=\"os-number\">4.3</span><span
        class=\"os-divider\"> </span><span class=\"os-caption\">The force exerted
        by a stretched spring can be used as a standard unit of force. (a) This spring
        has a length <math display=\"inline\"><semantics><mrow><mrow><mrow><mi>x</mi></mrow><mrow/></mrow></mrow><annotation-xml
        encoding=\"MathML-Content\"><semantics><mrow><mrow><mi>x</mi></mrow><mrow/></mrow><annotation
        encoding=\"StarMath 5.0\"> size 12{x} {}</annotation></semantics></annotation-xml></semantics></math>
        when undistorted. (b) When stretched a distance <math display=\"inline\"><semantics><mrow><mrow><mrow><mn>\u0394</mn><mi
        fontstyle=\"italic\">x</mi></mrow><mrow/></mrow></mrow><annotation-xml encoding=\"MathML-Content\"><semantics><mrow><mrow><mn>\u0394</mn><mi
        fontstyle=\"italic\">x</mi></mrow><mrow/></mrow><annotation encoding=\"StarMath
        5.0\"> size 12{Dx} {}</annotation></semantics></annotation-xml></semantics></math>,
        the spring exerts a restoring force, <math display=\"inline\"><semantics><mrow><mrow><mrow><msub><mtext
        mathvariant=\"bold\">F</mtext><mrow><mtext>restore</mtext></mrow></msub></mrow><mrow/></mrow></mrow><annotation-xml
        encoding=\"MathML-Content\"><semantics><mrow><mrow><msub><mtext mathvariant=\"bold\">F</mtext><mrow><mtext>restore</mtext></mrow></msub></mrow><mrow/></mrow><annotation
        encoding=\"StarMath 5.0\"> size 12{F rSub { size 8{\"restore\"} } } {}</annotation></semantics></annotation-xml></semantics></math>,
        which is reproducible. (c) A spring scale is one device that uses a spring
        to measure force. The force <math display=\"inline\"><semantics><mrow><mrow><mrow><msub><mtext
        mathvariant=\"bold\">F</mtext><mrow><mtext>restore</mtext></mrow></msub></mrow><mrow/></mrow></mrow><annotation-xml
        encoding=\"MathML-Content\"><semantics><mrow><mrow><msub><mtext mathvariant=\"bold\">F</mtext><mrow><mtext>restore</mtext></mrow></msub></mrow><mrow/></mrow><annotation
        encoding=\"StarMath 5.0\"> size 12{F rSub { size 8{\"restore\"} } } {}</annotation></semantics></annotation-xml></semantics></math>
        is exerted on whatever is attached to the hook. Here <math display=\"inline\"><semantics><mrow><mrow><mrow><msub><mtext
        mathvariant=\"bold\">F</mtext><mrow><mtext>restore</mtext></mrow></msub></mrow><mrow/></mrow></mrow><annotation-xml
        encoding=\"MathML-Content\"><semantics><mrow><mrow><msub><mtext mathvariant=\"bold\">F</mtext><mrow><mtext>restore</mtext></mrow></msub></mrow><mrow/></mrow><annotation
        encoding=\"StarMath 5.0\"> size 12{F rSub { size 8{\"restore\"} } } {}</annotation></semantics></annotation-xml></semantics></math>
        has a magnitude of 6 units in the force standard being employed.</span></div></div><div
        data-type=\"note\" data-has-label=\"true\" id=\"fs-id2631420\" data-label=\"\"><h3
        class=\"os-title\" data-type=\"title\"><span data-type=\"\" id=\"4\" class=\"os-title-label\">Take-Home
        Experiment: Force Standards</span></h3><div class=\"os-note-body\">\n            <p
        id=\"import-auto-id2686295\" class=\" \">To investigate force standards and
        cause and effect, get two identical rubber bands. Hang one rubber band vertically
        on a hook. Find a small household item that could be attached to the rubber
        band using a paper clip, and use this item as a weight to investigate the
        stretch of the rubber band. Measure the amount of stretch produced in the
        rubber band with one, two, and four of these (identical) items suspended from
        the rubber band. What is the relationship between the number of items and
        the amount of stretch? How large a stretch would you expect for the same number
        of items suspended from two rubber bands? What happens to the amount of stretch
        of the rubber band (with the weights attached) if the weights are also pushed
        to the side with a pencil? </p>\n        </div></div>\n        \n        \n        \n        \n\n\n  </div></body>\n</html>"}'
